css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("youtube.com")
{
/* Like Coloring */
  #watch-like
  {
    border-color: #00FF00 !important;
    box-shadow: 0px 0px 4px 2px rgba(0, 255, 0, 1), 0 0 5px #00FF00 inset !important;
  }

/* Dislike Coloring */
  #watch-dislike
  {
    border-color: #FF0000 !important;
    box-shadow: 0px 0px 4px 2px rgba(255, 0, 0, 1), 0 0 5px #FF0000 inset !important;
  }
}
